Muchas Gracias por siempre apoyar mi música , gracias por siempre hacerme fuerte , gracias por  caminar de la mano apoyando mis sueños , mis locuras y lo que me sale del corazón;
Estoy muy contento por este Primer Millón de reproducciones en la era de los algoritmos y las campañas de internet , un millón totalmente orgánico en una canción que la grabe solo por que me gusta y la elegí en una reducida lista de mis canciones favoritas que quería grabar , Llego a ser tendencia en mexico en el top 20 , y sin planearlo vale como el #1 para mi , por eso esta producción tiene mucho valor personal , por ser un álbum que hice para mi y ustedes lo adoptaron con todo 💥👊🏻 
 Gracias por todo su cariño RV🤠 #Inventame

Hoy estoy muy contento de poderles contar que tenemos festejo doble 🥳 Quiero compartir gran parte de mis sueños, desde niño siempre supe lo que quería ser  y soñaba con una y tantas cosas que Dios me ha concedido y muchas tantas que se van a llegar en su momento como todo ;
Aveces tenemos mas de lo que merecemos y otra veces anhelamos cosas que no merecemos todavía, el tiempo y las cicatrices te van diciendo el por que de las cosas y cuando llegan sabes el por que no las merecías;
Hoy después de 15 años de trabajar duro con altas y bajas, pero con los sueños y metas siempre en mi mente, me enorgullece cumplir un sueño mas para mi, siempre soñé con tener hijos, y siempre quise que llevaran mi legado mas allá de lo que yo pudiera ser, y entre mis locos sueños hacer una dinastía con música que marcara  géneros, generaciones, y poder seguir transmitiendo todo lo que se siente con la música ; 
 Hoy doy mi primer paso a Grandes sueños, a nuevos comienzos , nuevos pasos que bendigo con mi alma que de todo corazón quiero siempre lo mejor  para el y su carrera que apenas inicia, 
